B.UP=new A.bM('When you open the app, you will start on the main map page. To find fandoms/categories, tap the second icon in the bottom navigation bar (the tag icon) to navigate to the "Tags" page. \n\nHere, you can browse or use the search bar to find the tag you want (this can be things like Arcane, Bob\'s Burgers, Nature, Crochet, etc). \n\nYou will also see a count on the right of the tags indicating how many artists have this tag. Selecting a tag will return you to the map page, but now with the stalls highlighted GREEN with a PIN, showing where the artists with this tag are located.\n\nYou will need to zoom out and pan to find the GREEN stalls but there is a list of stall numbers on the left-hand side of the screen to aid in your navigation. \n\nTowards the left of the map (in Halls 3 and 4) you will find stalls that begin with C. Middle of the map (Hall 2) you will find stalls that begin with B. And towards the right side of the map (Hall 1) you will find stalls that begin with A.\n\nSelecting a stall will highlight it PINK with a STAR in which you can then tap the banner to view more details on that artist. \n\n',null,null,B.B,null,null)
B.US=new A.bM("Locating Artists:\n",null,null,B.B,null,B.ij)
